import React from 'react';
import FundoAwards from '../images/FundoAwards.png';

function AwardsPage() {
    return (
        <section id="AwardsPage" className="w-full min-h-[2000px] bg-gradient-to-b from-magic-200 to-magic-400 z-[99]">
            <div className=" bg-center bg-cover min-h-[2000px] w-full" style={{ backgroundImage: `url(${FundoAwards})` }}></div>
            
        </section>
    );
}

export default AwardsPage;
